import axios from 'axios';
/*
const api = axios.create({
  baseURL: 'http://localhost:5000',
});
*/

var salasService = {
  getSalas: async () => {
    var salaAPI = axios.get('http://localhost:5000/salas');
    return await salaAPI;
  },
  getOnesalas: async (id) => {
    var salaAPI1 = await axios.get('http://localhost:5000/salas/'+ id)
    return salaAPI1;
  }
};

export default salasService;
